recommended that they are reviewed.\r\n        </div>\r\n    </div>\r\n\r\n    <div class="description">\r\n        <h1>SQL Code Analysis Issues</h1>\r\n        <p>\r\n        SQL Change Automation has run the script through the <a href="https://www.red-gate.com/comparison-report/analysis/codeanalysis/">Code Analysis</a> tool.\r\n        This tool checks the script against a library of SQL best practice rules, covering deprecated syntax, execution, naming, performance and style.\r\n        Code Analysis rules can be enabled and disabled by configuring the settings file.<br>\r\n        <a href="https://www.red-gate.com/comparison-report/analysis/documentation">See online documentation</a> for more information.\r\n        </p>\r\n    </div>\r\n\r\n    <div class="warning low">\r\n        <div class="details">\r\n            <i class="fa fa-exclamation-circle" style="color: #2780e3"></i>\r\n            We are currently trialing the SQL Code Analysis issues feature. We\'d love to know what you think. <a href="https://www.red-gate.com/comparison-report/analysis/feedback">Give us your feedback</a>\r\n        </div>\r\n    </div>\r\n\r\n    <table class="table" data-bind="visible: issues().length > 0">\r\n        <thead>\r\n            <tr>\r\n                <th>Issue code</th>\r\n                <th>Issue type</th>\r\n                <th>Severity</th>\r\n                <th>Line</th>\r\n            </tr>\r\n        </thead>\r\n\r\n        <tbody data-bind="foreach: issues">\r\n            <tr>\r\n                <td><a data-bind="attr: { href: \'https://documentation.red-gate.com/display/codeanalysis/\' + code, target: \'_blank\' }, text: code"></a></td>\r\n                <td data-bind="text: title"></td>\r\n                <td>\r\n                    <i class="fa fa-times-circle" style="color: #c00" data-bind="visible: severity == \'Error\'"></i>\r\n                    <i class="fa fa-exclamation-triangle" style="color: #fed100" data-bind="visible: severity == \'Warning\'"></i>\r\n                    <span data-bind="text: severity"></span>\r\n                </td>\r\n                <td data-bind="text: line"></td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n\r\n<div data-bind="visible: issues().length === 0">\r\n    There are no code analysis issues in the deployment script.\r\n</div>\r\n\r\n<strong>The database is compliant with <span data-bind="text: passedRules().length"></span> out of <span data-bind="text: rules().length"></span> rules.</strong>\r\n\r\n<div data-bind="visible: passedRules().length">\r\n    <a data-bind="click: toggleRulesPassed" style="cursor:pointer">\r\n        <i class="fa" data-bind="css: {\'fa-chevron-up\': !expanded(), \'fa-chevron-down\': expanded}"></i> Show all the code analysis rules that passed\r\n    </a>\r\n    <table class="table" data-bind="visible: expanded">\r\n        <thead>\r\n            <tr>\r\n                <th>Rule code</th>\r\n                <th>Rule type</th>\r\n                <th>Status</th>\r\n            </tr>\r\n        </thead>\r\n\r\n        <tbody data-bind="foreach: passedRules">\r\n            <tr>\r\n                <td><a data-bind="attr: { href: \'https://documentation.red-gate.com/display/codeanalysis/\' + code, target: \'_blank\' }, text: code"></a></td>\r\n                <td data-bind="text: title"></td>\r\n                <td>\r\n                    <i class="fa fa-check-circle" style="color: #1aac1e"></i>\r\n                    <span>Passed</span>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n'}),n("text!views/script.html",[],function(){return'<div class="sql-script-holder">\r\n    <div class="pull-right header">\r\n        <button data-bind="selecttext: \'table.script-content\'" class="btn btn-primary btn-xs"><i class="fa fa-file-text"></i> &nbsp; Select all</button>\r\n    </div>\r\n\r\n    <div class="clearfix"></div>\r\n\r\n    <pre class="content" data-bind="html: script"></pre>\r
